import UIKit

//https://leetcode.com/problems/longest-substring-without-repeating-characters/description/?envType=study-plan-v2&envId=top-interview-150

func lengthOfLongestSubstring(_ s: String) -> Int {
    guard !s.isEmpty else { return 0 }
    var len = 0, chars = [Character]()
    for c in s {
        if let idx = chars.firstIndex(of: c) {
            chars.removeSubrange(0...idx)
        }
        chars.append(c)
        len = max(len, chars.count)
    }
    return len
}

func lengthOfLongestSubstringMethodTwo(_ s: String) -> Int {
    if s.count == 0 {
        return 0
    }
    var window_start = 0, window_Length = 0, longest = 0
    var lastSeenAt : [Character : Int] = [:]
    for (index, val) in s.enumerated() {
        if lastSeenAt[val] == nil {
            lastSeenAt[val] = index
        } else {
            if lastSeenAt[val]! >= window_start {
                window_Length = index - window_start
                longest = max(longest, window_Length)
                window_start = lastSeenAt[val]! + 1
            }
            lastSeenAt[val] = index
        }
    }
    let endIndex = s.endIndex
    let index = s.distance(from: s.startIndex, to: endIndex)
    if longest < index - window_start {
        longest = index - window_start
    }
    return longest
}



